car el trabajo que realizará en tiempo y forma para entregar nuevas funcionalidades en los productos a nuestros usuarios y clientes.• Seguir y cumplir las definiciones deDoRyDoDque tengan las células, así como proponer mejoras a estos acuerdos para poder asegurar un trabajo alineado, ordenado, sin obstáculo y poder ser autónomos en su día a día.FormaciónTitulado de Ingeniería Informática, Ingeniero Civil Informática o afín.ExperienciaDesde 3 años de experiencia en roles similares.Conocimiento técnico• Experiencia enNodeJSconTypescripty algúnframework (de preferenciaNestJS) (excluyente).• Experiencia en bases de datos comoPostgresql(excluyente).• Experiencia en desarrollo de pruebas unitarias conframeworkcomoJestJS(excluyente).• Experiencia en desarrollo con arquitectura de microservicios (hexagonal deseable)(excluyente).• Experiencia trabajando con API REST• Experiencia en GIT, repositorios yversionamientode software (GitLabde preferencia).• Conocimiento de Docker• Experiencia con proyectos de desarrollo en Cloud (preferencia GCP).• Dominio de herramientas para la automatización de los procesos de desarrollo de software• Conocimiento en CI / CDCondiciones del cargo• Contrato : Indefinido.• Modalidad : 4 días presencial, 1 día homeoffice.En CMPC promovemos una cultura de inclusión y diversidad, centrada en las personas, que promueve el respeto y la igualdad de oportunidades.Nuestras vacantes aceptan personas sin distinción de identidad y / o expresión de género, con todas las características físicas y / o discapacidad, de cualquier generación y nacionalidad, sin importar raza o etnia y orientación afectiva.¡Te invitamos a trabajar con nosotros, alcanzar tu máximo potencial y crear fibra natural para un futuro mejor!#J-18808-LjbffrMostrar descripción completaDenunciar esta publicación de empleoCargando…

