I/CD y arquitecturas de microservicios.¿Qué Ofrecemos?• Bono de cumpleaños, fiestas patrias y navidad.• Acceso a nuestro palco VIP en Movistar Arena como beneficio adicional de cumpleaños.• Seguro Complementario de Salud.• Convenio Colectivo FALP.• Ambiente de apoyo y crecimiento.Compromiso con la Diversidad e InclusiónEn Yol1 promovemos un ambiente laboral diverso, equitativo e inclusivo. Valoramos las distintas perspectivas y experiencias, y creemos que estas enriquecen nuestro equipo. Todas las personas son bienvenidas a postular, sin distinción de género, orientación sexual, edad, nacionalidad, origen étnico, religión o discapacidad.Mostrar descripción completaDenunciar esta publicación de empleoCargando…

