 de bases de datos relacionales: SQL Server, PostgreSQL o MySQL.• Experiencia con Docker (deseable Kubernetes).• Uso avanzado de Git.Requisitos deseablesExperiencia con bases de datos NoSQL (MongoDB, Redis).• Experiencia con herramientas CI/CD.• Conocimientos en mensajería (Kafka, RabbitMQ u otros).• Deseable experiencia en Retail.Beneficios y entornoEn BC Tecnología promovemos un ambiente de trabajo colaborativo que valora el compromiso y el aprendizaje constante. Nuestra cultura se orienta al crecimiento profesional a través de la integración y el intercambio de conocimientos entre equipos.La modalidad híbrida que ofrecemos, ubicada en Las Condes, permite combinar la flexibilidad del trabajo remoto con la colaboración presencial, facilitando un mejor equilibrio y dinamismo laboral.Participarás en proyectos innovadores con clientes de alto nivel y sectores diversos, en un entorno que fomenta la inclusión, el respeto y el desarrollo técnico y profesional.Mostrar descripción completaDenunciar esta publicación de empleoCargando…

