es CI/CD, infraestructura como código y automatización de procesos.• Manejo de bases de datos PostgreSQL, MongoDB o Cosmos DB en entornos cloud.• Formación académica en Ingeniería en Sistemas, Informática o carrera afín.Qué ofrecemos• Una comunidad internacional que reúne a más de 110 nacionalidades diferentes.• Un entorno donde la confianza ocupa un lugar central: el 70% de nuestros líderes clave comenzaron su carrera en el primer nivel de responsabilidades.• Un sólido sistema de formación con nuestra Academia interna y más de 250 módulos disponibles.• Un entorno de trabajo vibrante con frecuentes eventos internos (afterworks, team buildings, etc.).• Fuerte compromiso con la RSE, especialmente a través de la participación en nuestro programa WeCare Together.Amaris Consulting se enorgullece de ser un lugar de trabajo con igualdad de oportunidades. Estamos comprometidos con la promoción de la diversidad dentro de la fuerza de trabajo y la creación de un ambiente de trabajo inclusivo. Para ello, damos la bienvenida a las solicitudes de todos los candidatos cualificados, independientemente de su género, orientación sexual, raza, etnia, creencias, edad, estado civil, discapacidad u otras características.Who are we?Amaris Consulting es una firma independiente de asesoría tecnológica que ofrece servicios de orientación y soluciones para las empresas.Reúne a más de 7 600 personas distribuidas en 5 continentes y más de 60 países. Con más de 1 000 clientes en todo el mundo, hemos implementado soluciones en proyectos importantes durante más de una década.Nuestros especialistas cubren sectores que abarcan desde servicios financieros y transporte hasta atención sanitaria y tecnología.Amaris es su ‘stepping stone’ para atravesar ríos de cambio, afrontar retos y realizar todos sus proyectos con éxito.Mostrar descripción completaDenunciar esta publicación de empleoCargando…

