roducción.• Recibir sistemas de información de proveedores y validarlos respecto a los estándares tecnológicos y de calidad. Los sistemas de información desarrollados por terceros deben quedar validados y listos para entregarlos a Control de Calidad.🧠 ¿Qué necesitamos?• Formación académica: Ingeniería Informática o carrera afín.• Experiencia de al menos 3 años como Desarrollador Backend, desarrollando APIs y códigos funcionales, completas y eficientes.• Conocimientos de programación orientada a objeto en Java 8 en adelante, Python.• Experiencia en el desarrollo, integración y optimización de servicios RESTful API.• Conocimiento de servicios web y herramientas de gestión y seguimiento como Jira, Confluence.• Experiencia con bases de datos SQL y NoSQL como Oracle PLSQL, MySql y MongoDB.• Experiencia con Serverless Framework o terraform para desarrollo en cloud AWS. Servicios de referencia: Lambda, Api gateway, S3, step functions, SQS.• Conocimientos en versionamiento de código como Git, GitHub y CI/CD.✨Sumarás puntos si cuentas con:• Deseable experiencia y/o conocimientos en Frontend (React, Next).• Experiencia como Desarrollador en un equipo Agile (deseable).¿Cómo es trabajar en BICE Vida? 🤝💼• Contamos con la mejor cobertura de la industria y te brindamos un seguro complementario de salud, dental y vida, y además un seguro catastrófico (Para ti y tus cargas legales). 🏅• Bonos en UF dependiendo de la estación del año y del tiempo que lleves en nuestra Compañía. 🎁• Salida anticipada los días viernes, hasta las 14:00 hrs, lo que te permitirá balancear tu vida personal y laboral. 🙌• Dress code semi-formal, porque privilegiamos la comodidad. 👟• Almuerzo gratis en el casino corporativo, con barra no-fit el dia viernes. 🍟• Contamos con capacitaciones constantes, para impulsar y empoderar equipos diversos con foco en buscar mejores resultados.• Puedes venir en bicicleta y la cuidamos por ti. Tenemos bicicleteros en casa matriz. 🚲GETONBRD Job ID: 58823Wellness programBICE VID