eway, EKS, CloudWatch).• Implementar pipelines CI/CD con GitLab.• Automatizar pruebas con JUnit (y Karate).• Gestionar dependencias con Gradle.• Aplicar control de calidad con SonarQube.• Trabajar bajo Kanban / Jira.• Participar en revisiones de arquitectura y buenas prácticas.Requisitos del perfil — EXCLUYENTES• Experiencia reciente desarrollando backend en Java 21.• Uso productivo de Spring Boot 3 y WebFlux.• Diseño de microservicios y principios OOP.• Integración de mensajería con Kafka o SQS.• Implementación de pipelines CI/CD con GitLab.• Automatización de pruebas con JUnit.• Uso de Git en equipos colaborativos.• Experiencia trabajando bajo Kanban / Jira.• Requisitos deseables• Experiencia con Spring Boot 2.7.• Uso de bases NoSQL (MongoDB / Redis).• Experiencia en AWS.• Conocimiento del estándar TMF en proyectos telco.• Arquitecturas event-driven.• Optimización de recursos en Kubernetes.• Observabilidad en AWS.Condiciones del cargo• Jornada completa• Modalidad: Remoto, sin embargo requiere disponibilidad para asistir a reuniones eventuales que convoque el cliente.• Contrato: Plazo fijo luego indefinido• Ubicación: Santiago RM#Babel¿Qué ofrecemos?Babel, the great way to achieve the success.¿Quieres formar parte de un equipo en expansión, comprometido e innovador que hace historia cada día? En Babel te acompañamos en tu camino hacia el éxito. Creemos en el talento de las personas y lo queremos potenciar ofreciéndote un gran entorno de trabajo basado en la colaboración y la solidaridad.Trabajar en Babel es mucho más que trabajar en una empresa, es unirse a un equipo de personas con una misión compartida y a un modelo de compañía centrado en valores.Además,• Apostamos por la conciliación laboral-personal. (Sistema de vacaciones por puntos, teletrabajo y flexibilidad).• Invertimos en la formación de nuestros Babelievers.• Participamos del crecimiento de la compañía y reconocemos la participación de cada persona (Bono de Reparto).• Ponemos foco en trabajar con últimas tecnologías y proyectos innovadores, pero sobre todo, acompañamos a la transformación digital y acercamos la tecnología a la sociedad.¿Aceptas el desafío? ¡Te esperamos!En cumplimiento de la normativa vigente en materia de protección de datos te informamos que el responsable de tus datos personales es GRUPO BABEL (consultar empresas en la política de privacidad), y los utilizará para gestionar tus procesos de selección, tanto actuales como futuros y el resto de finalidades descritas en la web. Este tratamiento está basado en el consentimiento del candidato. Los datos personales recabados no serán en ningún caso cedidos a terceros salvo por obligaciones legales expresas. Puedes ejercer los derechos que te asisten sobre protección de datos en la direccióndata.protection@babelgroup.com. Toda la información sobre política de privacidad en nuestra web.Mostrar descripción completaDenunciar esta publicación de empleoCargando…
